QUEUE_TYPE_BASE)); Add a function which that will be called whenever there is a GPIO interrupt on our button pin. We put this function in a special block of RAM (iram0), so it will still be available even if the external flash is busy doing something else (like filesystem work). The function needs to get the queue handle from EVENT_QUEUE and call the xQueueGiveFromISR function with a std::ptr::null_mut() - the objects in our queue are of size zero, so we don't actually need a 'thing' to put on the queue. Instead, the act of pushing a 'nothing' is enough to wake up the other end! #[link_section = ".iram0.text"]
unsafe extern "C" fn button_interrupt(_: *mut c_void) { xQueueGiveFromISR(EVENT_QUEUE.unwrap(), std::ptr::null_mut());
